import React from "react";

const MySelect = ({ options, defaultValue }) => {
  return (
    <select name="" id="">
      <option disabled>{defaultValue}</option>
      {options.map(option =>
        <option key={value} value={option.value}>
          {option.name}
        </option>
      )}
    </select>
  );
};

export default MySelect
